import React from 'react';
import './TodoSearch.css'

function TodoSearch({
    searchValue,
    setSearchValue,
}) {

    return (
        <input 
            placeholder="Search something..."
            className="TodoSearch"
            value={searchValue}
            onChange={(event) => {
                setSearchValue(event.target.value);
            }}
        />
    )
}

export { TodoSearch };
